  false,\n\t\"url\": null,\n\t\"notes\": \"Northwest Pennsylvania has been an important
  stop for waterfowl on the Atlantic Flyway. To supplement the established waterfowl
  management program of the Game Commission, the Migratory Bird Conservation Commission
  approved acquisition of the Erie National Wildlife Refuge in 1958 with funds from
  the Migratory Bird Hunting Stamp Act. This 5, 150- acre refuge, together with other
  existing and planned State and Federal projects, will improve northwestern Pennsylvania
  as a key nesting and resting area for waterfowl using the western portion of the
  Atlantic Flyway. Erie Refuge will also provide excellent recreation for people who
  enjoy wildlife and wild areas. A visitor center, nature trails, and other facilities
  will increase public use. This plan outlines refuge goals and objectives in 1966.\",\n\t\"license_title\":
